cd ~
text=""

echo -n "Path to location: "
read -r path

if [[ -d "$path" ]]; then
    echo "Path already exists, aborting"
    exit 0
else
    echo "Path doesn't exist, making path"
    mkdir "$path"
    mkdir "${path}/bomb"
fi

echo "Running Script on $path"

for i in {1..500}; do
    touch "$path/bomb/$i.txt"
    echo "$text" > "$path/bomb/$i.txt"
    echo "Wrote file $i"
done

sleep 10

clear

cd "${path}"
echo "Saving bomb"
zip -r bomb.zip "bomb"